  \"Higher performance and lower cost optical DPSK receiver Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T15:23:49.369428\",\n\t\"name\": \"higher-performance-and-lower-cost-optical-dpsk-receiver-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;To demonstrate (benchtop experiment)
  a DPSK receiver with a free-space interferometer, showing that fiber-optic coupling,
  associated adaptive optics, and optical preamplification can be avoided, with potential
  large cost savings; To rigorously quantify the performance (capacity and photon-budget)
  tradeoff between conventional (adaptive optics + optical preamplification) systems
  and our proposed free-space photon-counting-array approach; To develop extensions
  to orthogonal phase-modulated signaling over multiple symbols and associated photon-counting
  receiver structures, which enable approaching the photon efficiency of high-order
  pulse position modulation.&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government
